import { Message } from "../component/MessagePage";
import './css/AppAffichage.css';
import {NavBar} from '../component/NavBarFront';

export const MessagePar = () => {
    return(
        
        <div className='row'>
            <div className='col-md-4'><NavBar/></div>
            <div className='col-md-8'><Message/></div>
        </div>
    );
}
